  return (
    <div>
      <Layout>
        <div className="aboutContainer">
          <div className=" row">
            <img
              className="pic"
              src={`${process.env.PUBLIC_URL}/lola.jpeg`}
              // style={{
              //   width: "50%",
              //   height: "50%px",
              // }}
              alt="Avatar"
            />
          </div>
          <div className="aboutContEl row">
            <h1> A little bit about myself</h1>
            <p>
              Maybe something to conclude my experience and I could add some
              text with web.
            </p>
          </div>
        </div>
      </Layout>
    </div>
  );
};

export default About;
